function FeatureItem(icon, h3, p, alt) {
  return (
    <div class="feature-item">
      <img src={icon} alt={alt + " Icon"} class="feature-icon" />
      <h3 class="feature-item-title">{h3}</h3>
      <p>{p}</p>
    </div>
  );
}

export default FeatureItem;
